import React from 'react';
import './style.scss';
import { Link } from 'react-router-dom';

function Home() {

    return (
        <div className="bg">
            <div className="home-container">
                <div className="home-content">
                    <Link to="/dashboard/races">Dashboard</Link>
                </div>
            </div>
        </div>
    );
}

export default Home;
